import React, { Component } from "react";
import {  Input, Table, Card, Button } from 'antd';
import { SearchOutlined } from '@ant-design/icons';
import styles from './css/index.module.css'
import { Link } from 'react-router-dom'
import axios from '../../axios'
let meetdata = [];

const { Search } = Input;

const columns = [{
    title: '会议主题',
    dataIndex: 'roomName',
    width: '20%',
    align: 'center'
}, {
    title: '创建时间',
    dataIndex: 'createDate',
    width: '20%',
    align: 'center'
}, {
    title: '会议号',
    dataIndex: 'isPublic',
    align: 'center'
}, {
    title: '状态',
    dataIndex: 'lockStatus',
    align: 'center'
},
{
    title: '操作',
    dataIndex: 'id',
    align: 'center'
}
]

const onSearch = value => console.log(value);

class MeetList extends Component {


    constructor(props) {
        super(props)
        this.state = {}
    }

    componentDidMount() {

        var params = { page: 1 };
        this.getMeetData(params);

    }

    getMeetData(params) {
        axios.getMeetList().then((res) => {
            console.log(res)
            meetdata = res.response.data;

            console.log(meetdata)

        })
    }


    render() {

        return (
            <Card title="会议列表"  >

                <Input.Group compact>
                    <Search
                        placeholder="视频会议关键字"
                        allowClear
                        enterButton="Search"
                        size="large"
                        className="{styles.SearchInput}"
                        onSearch={onSearch}
                    />
                 
                    <Input.Search allowClear style={{ width: '40%' }} defaultValue="26888888" />

                    <Button  type="primary" icon={<SearchOutlined />}  >新建会议</Button>
                </Input.Group>
               

                <Table bordered
                    dataSource={meetdata}
                    columns={columns}
                    pagination={{ position: ['none', 'bottomRight'] }}
                > </Table>
            </Card>
        )
    }
}

export default MeetList
